import React from 'react';
import './Header.css';
import model3d from '../assets/final_island_2.glb'
import skyback from '../assets/sky1.jpg'

function Header() {
	return (
		<header>
			<div class="demo" style={{ overflowX: 'hidden' }}>

				<span style={{ position: 'absolute', textAlign: 'center', fontSize: '250px', fontWeight: '900', transform: 'translate(-50%, -50%)', left: '50%', top: '50%' }}>TEAM TREES</span>

				<model-viewer alt="3d model" src={model3d} camera-controls disable-zoom interpolationDecay={200}></model-viewer>

			</div>

			<div className='modelclass'>
				<div className='modelhead'>
					<span style={{ position: 'absolute', textAlign: 'center', fontSize: '250px', fontWeight: '900', transform: 'translate(-50%, -50%)', left: '50%', top: '50%' }}>TEAM TREES</span>
				</div>
				<div className='modelmodel'>
					<model-viewer alt="3d model" src={model3d} camera-controls disable-zoom interpolationDecay={200}></model-viewer>
				</div>
			</div>

		</header>
	);
}

export default Header;
